import React from "react";
import { useState } from "react";


const Navbar = () => {

    const [searchKey, setSearchKey] = useState("")

    const searchMovies = (e) => {
        e.preventDefault()
    }


    return(

<nav className="navbar has-background-black-ter mb-4">
    <h3 className="navbar-item has-text-white">THE MOVIE DATA BASEEE</h3>
    <form onSubmit={searchMovies}>
        <input
            type="text" placeholder="Search" onChange={(e) => setSearchKey(e.target.value)}/>
        <button type={"submit"}>Search</button>
    </form>
    <div>{searchKey}</div>

    <div>

        <a href="http://localhost:3000/api/login">
            <strong>Log in</strong>

        </a>
    </div>

    <div>
        <a href="http://localhost:3000/api/register">
            <strong>Register</strong>
        </a>
    </div>

</nav>
)};

export default Navbar
